import React, { Component } from 'react';

class App22 extends Component {
    render() {
        var hour = new Date().getHours();

        if (hour >= 8 && hour <= 10) {
            //At GYM
            return (
                <div>
                    <p>At gym</p>
                </div>
            );
        } else {
            return (
                <div>
                    <p>Something</p>
                </div>

            );
        }
    }

}

export default App22;
